Array
(
    [path] => /tmp_uploads/
    [file] => ten.jpg
    [preview] => http://localhost/wc-pro-old/wp-includes/images/media/default.png
    [show_thumbnail] => 1
    [is_image] => 1
    [ext] => jpg
)
