function Section({ isMenuOpend, setIsMenuOpend }) {
  const [edit, setEdit] = useState(true);
  const [editImage, setEditImage] = useState(true);
  // const [token, setToken] = useState("");

  const initialState = {
    first_name: "",
    last_name: "",
    email: "",
    password: "",
    phone_number: "",
    address: "",
    profile_picture: "",
  };
  function profileReducer(state, action) {
    switch (action.type) {
      case "dataRecieved":
        return {
          ...state,
          first_name: action.payload.first_name,
          last_name: action.payload.last_name,
          email: action.payload.email,
          phone_number: action.payload.phone_number,
          password: action.payload.password,
          address: action.payload.address,
          profile_picture: action.payload.profile_picture,
        };
      case "editFirstName":
        return { ...state, first_name: action.payload };
      case "editLastName":
        return { ...state, last_name: action.payload };
      case "editPassword":
        return { ...state, password: action.payload };
      case "editPhoneNumber":
        return { ...state, phone_number: Number(action.payload) };
      case "editAddress":
        return { ...state, address: action.payload };
      case "editProfileImage":
        return { ...state, profile_picture: action.payload };
      default:
        break;
    }
  }
  const [
    {
      first_name,
      last_name,
      email,
      password,
      phone_number,
      address,
      profile_picture,
    },
    dispatch,
  ] = useReducer(profileReducer, initialState);
  function handleSubmit(e) {
    e.preventDefault();
  }
  return (
    <div className="section ">
      {!isMenuOpend && (
        <p className="burger close" onClick={() => setIsMenuOpend((e) => !e)}>
          ☰
        </p>
      )}
      <h4>Edit Profile</h4>

      <form className=" mt-5 " onSubmit={(e) => handleSubmit(e)}>
        <div className="image">
          <img
            src={`${profile_picture}`}
            alt="profile"
            className="rounded-circle"
          />
          <img
            src={Brush}
            className="profile-edit-icon"
            alt="brush-icon"
            onClick={() => setEditImage((e) => !e)}
          />
        </div>
        {!edit && !editImage && (
          <input
            type="file"
            alt="pickImage"
            className="pickImage"
            onChange={(e) =>
              dispatch({
                type: "editProfileImage",
                payload: e.target.value,
              })
            }
          />
        )}
        <div class="form-group name-form">
          <div className="w-50">
            <label for="firstName">First Name</label>
            <input
              value={first_name}
              onChange={(e) =>
                dispatch({ type: "editFirstName", payload: e.target.value })
              }
              id="firstName"
              type="text"
              className="form-control"
              placeholder="First Name"
              disabled={edit}
            />
          </div>
          <div className="w-50">
            <label for="lastName">Last Name</label>
            <input
              value={last_name}
              onChange={(e) =>
                dispatch({ type: "editLastName", payload: e.target.value })
              }
              id="lastName"
              type="text"
              className="form-control"
              placeholder="Last Name"
              disabled={edit}
            />
          </div>
        </div>
        <div class="form-group">
          <label for="email">Email</label>
          <input
            value={email}
            type="email"
            class="form-control"
            id="email"
            aria-describedby="emailHelp"
            placeholder="Enter email"
            disabled="true"
          />
        </div>
        <div class="form-group">
          <label for="password">New Password</label>
          <input
            onChange={(e) =>
              dispatch({ type: "editPassword", payload: e.target.value })
            }
            value={password}
            type="password"
            class="form-control"
            id="password"
            placeholder="Enter New Password"
            disabled={edit}
          />
        </div>
        <div class="form-group">
          <label for="number">Phone Number</label>
          <input
            value={phone_number}
            onChange={(e) =>
              dispatch({ type: "editPhoneNumber", payload: e.target.value })
            }
            type="number"
            class="form-control"
            id="number"
            placeholder="Phone Number"
            disabled={edit}
          />
        </div>
        <div class="form-group">
          <label for="address">Address</label>
          <input
