import 'package:stravafrontend/model/activity_data.dart';
import 'package:flutter/material.dart';
import 'package:pluto_grid/pluto_grid.dart';
import 'package:stravafrontend/data/gethttprequest.dart';


/// For more examples, go to the demo web link on the github below.
class PlutoGridExamplePage extends StatefulWidget {
  const PlutoGridExamplePage({Key? key}) : super(key: key);

  @override
  State<PlutoGridExamplePage> createState() => _PlutoGridExamplePageState();
}

late List<MaleSorted> malesorted;

List<PlutoColumn> _columns = [];
List<PlutoRow> _rows = [];


class _PlutoGridExamplePageState extends State<PlutoGridExamplePage> {
  late Future<ActivityDataRaw> data;

  Future<ActivityDataRaw> _loadData() async {
    data = getData();
    print(data);
    setState(() {});
    return data;
  }

  @override
  void initState() {
    data = getData();

    super.initState();

    final columnNames = [
      'Athlete Name',
      'Total Distance',
      'Total Outdoor Distance',
      'Total Indoor Distance',
      'Percent of Indoor',
      'Total Elevation',
      'Total Outdoor Elevation',
      'Total Indoor Elevation',
    ];

    for (String i in columnNames) {
      _columns.add(PlutoColumn(
        title: i,
        field: i,
        type: PlutoColumnType.text(),
        enableSorting: true,
        readOnly: true,
      ));
    }

    for (MaleSorted athlete in malesorted) {
      _rows.add(PlutoRow(
        cells: {
          'Athlete Name': PlutoCell(value: athlete.athleteName),
          'Total Distance': PlutoCell(value: athlete.totalDistance),
          'Total Outdoor Distance':
              PlutoCell(value: athlete.totalOutdoorDistance),
          'Total Indoor Distance':
              PlutoCell(value: athlete.totalIndoorDistance),
          'Percent of Indoor': PlutoCell(value: athlete.percentIndoor),
          'Total Elevation': PlutoCell(value: athlete.totalElevation),
          'Total Outdoor Elevation':
              PlutoCell(value: athlete.totalOutdoorElevation),
          'Total Indoor Elevation':
              PlutoCell(value: athlete.totalIndoorElevation),
        },
      ));
    }
  }

  final List<PlutoColumn> columns = _columns;
  final List<PlutoRow> rows = _rows;

  /// columnGroups that can group columns can be omitted.
  final List<PlutoColumnGroup> columnGroups = [
    PlutoColumnGroup(title: 'Distance', fields: [
      'Total Distance',
      'Total Outdoor Distance',
      'Total Indoor Distance',
      'Percent of Indoor',
    ]),
    PlutoColumnGroup(title: 'Elevation', fields: [
      'Total Elevation',
      'Total Outdoor Elevation',
      'Total Indoor Elevation',
    ]),
  ];

  /// [PlutoGridStateManager] has many methods and properties to dynamically manipulate the grid.
  /// You can manipulate the grid dynamically at runtime by passing this through the [onLoaded] callback.
  late final PlutoGridStateManager stateManager;

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      body: Container(
          padding: const EdgeInsets.all(15),
          child: FutureBuilder<ActivityDataRaw>(
            future: data,
            builder: (
              BuildContext context,
              AsyncSnapshot<ActivityDataRaw> snapshot,
            ) {
              print(snapshot.connectionState);
              if (snapshot.connectionState == ConnectionState.waiting) {
                return CircularProgressIndicator();
              } else if (snapshot.connectionState == ConnectionState.done) {
                if (snapshot.hasError) {
                  return const Text('Error');
                } else if (snapshot.hasData) {
                  return (PlutoGrid(
                    columns: columns,
                    rows: rows,
                    columnGroups: columnGroups,
                    onLoaded: (PlutoGridOnLoadedEvent event) {
                      stateManager = event.stateManager;
                    },
                    onChanged: (PlutoGridOnChangedEvent event) {
                      print(event);
                    },
                    configuration: const PlutoGridConfiguration(),
                  ));
                } else {
                  return const Text('Empty data');
                }
              } else {
                return Text('State: ${snapshot.connectionState}');
              }
            },
          )),
    );
  }
}

