import 'dart:convert';
import 'package:http/http.dart' as http;
import 'package:stravafrontend/model/activity_data.dart';

Future<ActivityDataRaw> getData() async {
  //Should get url from env variable
  const stravaAppDomain = 'my.domain.dev';
  const stravaAppDataEndpoint = '/dataapi/rider_totals';
  var url = Uri.https(stravaAppDomain, stravaAppDataEndpoint);
  print(url);
  Future<http.Response> fetchData() async {
    print(url);
    final response = await http.get(url);
    print(response);
    if (response.statusCode == 200) {
      // If the server did return a 200 OK response,
      // then parse the JSON.
      //return response;
      return response;
    } else {
      // If the server did not return a 200 OK response,
      // then throw an exception.
      throw Exception('Failed to load album');
    }
  }

  var r = await fetchData();
  var parsedJson = ActivityDataRaw.fromJson(jsonDecode(r.body));
  return parsedJson;
}

